```javascript
function sameAs<T extends Function | object>(fn: T): fn is T {
    return fn instanceof T || fn === T;
}
```

När du vill använda denna funktion kan du använda den med en typkänslig sammanhållningstyp, som i följande kod:

```javascript
function duckType<T extends Function | object>(fn: T): T {
    if (sameAs(fn) === true) {
        return fn;
    } else {
        throw new TypeError('Expected function or object');
    }
}
```

